(14, 33155, 1, 'yes', 'Sarah can do changeovers during the week but needs to take time off work, so difficult at short notice - needs a week notice!', '2016-10-11', '2016-10-11 21:14:50'),
(15, 33159, 1, 'yes', 'Spoke to Margaret on 12th October, shes\' happy to offer flexible cleaning in winter months but would rather stick to Saturday only change during the summer months', '2016-10-12', '2017-04-27 16:19:24'),
(18, 33158, 1, 'yes', 'See CASE #50612.\r\n\r\nKaren is now retired and can offer cleans on any days of the week but would prefer longer bookings and still to Sat - Saturday in season. ', '2016-10-15', '2017-05-28 18:12:42'),
(30, 33061, 1, 'yes', 'Changeovers mostly on Mon/Fri BUT they can do other days particularly if their owner booking departs, they will happily accept bookings starting on that day.', '2016-10-26', '2016-10-26 20:22:20'),
(43, 33118, 1, 'yes', 'Sara can potentially do other days but need to check as she has other jobs.\r\nShe would rather do Sundays than Saturdays, but not regularly.', '2016-11-04', '2017-05-28 18:12:59'),
(60, 32951, 1, 'yes', 'testing notes - Chris ', '2016-11-13', '2016-11-13 12:58:57'),
(105, 33093, 1, 'yes', 'Prefers Saturdays for Changeovers, possible on Mondays. \r\nWill take short break/weekend bookings in winter, CANNOT do changeovers on Thursday or Friday as she works elsewhere.\r\nMax 2 dogs (definitely no more)', '2016-12-22', '2017-05-28 18:12:59'),
(106, 33201, 1, 'yes', 'I usually can\'t do Tuesdays, but sometimes it\'s clear. \r\nWednesday and Thursday are usually clear but not always. \r\nSaturday and Sundays would normally be a no, if you\'re desperate just ask and I\'ll see what I\'m doing.\r\nBasically, if you need cover just give me a shout!!', '2017-01-30', '2017-05-28 18:12:59'),
(108, 33121, 1, 'yes', 'Â· The usual Sat to Sat or Sun to Sun, as we can do the cleaning on either of the days accordingly. Â· Long weekends Fri to Mon or Tues are also ok, as long as you could book out the days after for us ie Tues/Wed/Thurs. This will give us time to do the appropriate cleaning during the week (evenings).  We would really struggle to do changeovers days during the week as we both work still.', '2017-02-05', '2017-02-17 01:32:52'),
(110, 33121, 1, 'yes', 'Spoke to Andy, he said they are happy to clean on Friday as his work rota is now more relaxed. I\'ve updated the rules to try and improve low season booking.', '2017-03-14', '2017-03-14 15:50:25'),
(111, 33121, 1, 'yes', 'Understand. Yes, If a customer wants to book a Monday to Friday, please book out weekend before the Monday arrival, as we cannot do a Monday Change-over at the moment, whereas we can do a Friday Change-over as discussed. Likewise, if a customer wants Saturday to Monday, please book out Tuesday to Friday to give us time to prepare the cottage again.', '2017-03-20', '2017-05-28 18:12:59'),
(113, 33573, 1, 'yes', 'Moving house soon.  Tad  busy! Normal service will resume after easter. If we get any late bookings before then,  they\'ll be covered. Mobile number is 07766653884. There will be a few days after 17 th April when I\'ll be without Internet and landline at home(and no mobile reception) . I will be able to pick up emails at work but a text message might be best if there\'s a last minute booking in April!', '2017-03-27', '2017-05-28 18:12:59'),
