  `address_line1` varchar(95) DEFAULT NULL,
  `address_line2` varchar(95) DEFAULT NULL,
  `city` varchar(55) DEFAULT NULL,
  `county` varchar(55) DEFAULT NULL,
  `country` varchar(55) DEFAULT NULL,
  `email` varchar(95) DEFAULT NULL,
  `contact_num` varchar(15) DEFAULT NULL,
  `website` varchar(95) DEFAULT NULL,
  `monday_status` enum('open','closed') NOT NULL DEFAULT 'closed',
  `monday_opening` varchar(151) DEFAULT NULL,
  `monday_closing` varchar(151) DEFAULT NULL,
  `tuesday_status` enum('open','closed') NOT NULL DEFAULT 'closed',
  `tuesday_opening` varchar(151) DEFAULT NULL,
  `tuesday_closing` varchar(151) DEFAULT NULL,
  `wednesday_status` enum('open','closed') NOT NULL DEFAULT 'closed',
  `wednesday_opening` varchar(151) DEFAULT NULL,
  `wednesday_closing` varchar(151) DEFAULT NULL,
  `thursday_status` enum('open','closed') NOT NULL DEFAULT 'closed',
  `thursday_opening` varchar(151) DEFAULT NULL,
  `thursday_closing` varchar(151) DEFAULT NULL,
  `friday_status` enum('open','closed') NOT NULL DEFAULT 'closed',
  `friday_opening` varchar(151) DEFAULT NULL,
  `friday_closing` varchar(151) DEFAULT NULL,
  `saturday_status` enum('open','closed') NOT NULL DEFAULT 'closed',
  `saturday_opening` varchar(151) DEFAULT NULL,
  `saturday_closing` varchar(151) DEFAULT NULL,
  `sunday_status` enum('open','closed') NOT NULL DEFAULT 'closed',
  `sunday_opening` varchar(151) DEFAULT NULL,
  `sunday_closing` varchar(151) DEFAULT NULL,
  `slug` varchar(255) DEFAULT NULL,
  `place_cover_photo` varchar(255) DEFAULT NULL,
  `eat_gallery` longtext,
  `eat_image_alts` longtext,
  `for_site` enum('SR','ER','BOTH') NOT NULL DEFAULT 'ER',
  `er_page_title` varchar(255) DEFAULT NULL,
  `meta_keyword` text,
  `meta_description` varchar(271) DEFAULT NULL,
  `sr_page_title` varchar(255) DEFAULT NULL,
  `sr_meta_keyword` text,
  `sr_meta_description` varchar(271) DEFAULT NULL,
  `latitude` varchar(55) DEFAULT NULL,
  `longitude` varchar(55) DEFAULT NULL,
  `kid_allow` enum('yes','no') NOT NULL DEFAULT 'no',
  `dog_allow` enum('yes','no') NOT NULL DEFAULT 'no',
  `agg_review` float(10,2) DEFAULT NULL,
  `changes` enum('yes','no') DEFAULT 'no',
  `created` date NOT NULL,
  `modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

