(31, 'The Bottom Ship', 'active', '78', 'Pub,Restaurant', '2', 'The Bottom Ship Inn is situated in the picturesque location of Porlock Weir, a 15th Century hamlet overlooking the Bristol Channel.\r\n\r\nWe are a small independently run free house with ample outdoor seating for those enjoying a sunny day spent in the tranquillity of our little corner of Somerset and a roaring log fire for the wet and windy countryside afternoons. We serve a great selection of homemade food coupled with local ales, lagers and cider.\r\n\r\nWe are very dog friendly and families with children are more than welcome.\r\n\r\nBeing right on the South West Coast Path, Porlock Weir is an ideal stopover for walkers and also for those who just want to escape for a few days R&R.\r\n\r\nPorlock Weir itself has several shops in keeping with the attractive surroundings as well as a small museum highlighting the history of the village.\r\n\r\nThe harbour is an old fishing weir, but now the fishing trade has gone (although you will still see a boat or 2!) the village has become a popular destination for day visitors to come and enjoy the beautiful surroundings and for those wanting to stay a bit longer and relax in relative peace and quiet.', 'TA24 8PB', 'The Ship Inn', 'Porlock Weir', 'Minehead', 'Somerset', 'United Kingdom', 'enquiries@shipinnporlockweir.co.uk', '+44(0) 1643 863', 'https://www.shipinnporlockweir.co.uk/food-drink/', 'open', '9:00', '23:00', 'open', '9:00', '23:00', 'open', '9:00', '23:00', 'open', '9:00', '23:00', 'open', '9:00', '23:00', 'open', '9:00', '23:00', 'open', '9:00', '23:00', 'the-bottom-ship', '20201014104129the-ship-inn-porlock-fish-and-chips-e1542974059897.jpg', 'a:5:{i:0;s:43:\"20201009114658Ship-Inn-Porlock-Weir-013.jpg\";i:1;s:23:\"20201014100743steak.jpg\";i:2;s:68:\"20201014101644the-ship-inn-porlock-fish-and-chips-e1542974059897.jpg\";i:3;s:55:\"20201014102009Ship-Inn-Porlock-Weir-bar-012-lighter.jpg\";i:5;s:49:\"20210123025956Ship-Inn-Porlock-Weir-front-016.jpg\";}', NULL, 'ER', NULL, NULL, NULL, NULL, NULL, NULL, '51.2178821', '-3.6276859', 'yes', 'yes', 10.00, 'yes', '2020-10-09', '2021-03-11 16:18:54'),
(32, 'The Harbour Gallery and Cafe', 'active', '78', 'Cafe', '1', 'You wonâ€™t be able to resist the temptation of homemade cakes, scones, snacks and lunches all made by us.  Try the popular smoked fish and shellfish platter', 'TA24 8PD', 'Unit 1', 'Porlock Weir', 'Minehead', 'Somerset', 'United Kingdom', '', '01643 863514', 'http://www.harbourgalleryandcafe.co.uk/menus', 'closed', NULL, NULL, 'closed', NULL, NULL, 'closed', NULL, NULL, 'closed', NULL, NULL, 'closed', NULL, NULL, 'closed', NULL, NULL, 'closed', NULL, NULL, 'harbour-gallery-and-cafe', '2020101411230381024732_2583954738517596_4760334239541493760_n.jpg', 'a:10:{i:0;s:35:\"20201009120221Harbour_gallery_1.jpg\";i:1;s:65:\"2020101411103681024732_2583954738517596_4760334239541493760_n.jpg\";i:2;s:66:\"20201014111135115987806_2753727884873613_2351476522953772949_n.jpg\";i:3;s:66:\"20201014111140116797928_2759692397610495_1597544324317221303_n.jpg\";i:4;s:65:\"2020101411120690030767_2647139435532459_1784479768125636608_n.jpg\";i:5;s:65:\"2020101411133185095476_2614909432088793_2224074872076632064_o.jpg\";i:6;s:31:\"20201014111420photo0jpg_(1).jpg\";i:7;s:66:\"20201014111445118354310_2786359774943757_2492318442902522440_n.jpg\";i:8;s:66:\"20201014111500118354310_2786359774943757_2492318442902522440_n.jpg\";i:9;s:65:\"2020101411301865308718_2422877717958633_7050852552039989248_o.jpg\";}', NULL, 'ER', NULL, NULL, NULL, NULL, NULL, NULL, '51.2208055', '-3.6284557', 'yes', 'yes', NULL, 'no', '2020-10-09', '2020-11-17 13:37:04'),
(33, 'Ziangs', 'active', '79', 'Chinese,Asian', '2', 'We have been cooking real street food from China, Malaysia, Indonesia and Thailand for over 3 Generations.\r\n\r\nServing the best street food in the area since the 1950\'s.  menu only features 5-6 main dishes because we believe in doing a few things well rather than a lot okay, we know this could get boring, which is why we change the menu every 2-3 weeks, this keeps it fun and exciting for the customers and the kitchen team! It\'s also one of the reasons we don\'t hand out menus.', 'TA24 5AY', '35a The Avenue', '', 'Minehead', 'Somerset', 'United Kingdom', 'ziangs35a@gmail.com', '', 'https://www.ziangs35a.com', 'closed', NULL, NULL, 'open', '12:00', '18:00', 'open', '12:00', '18:00', 'open', '12:00', '18:00', 'open', '12:00', '18:00', 'open', '12:00', '18:00', 'open', '12:00', '16:00', 'ziangs', '20201014114912pad-thai.jpg', 'a:4:{i:0;s:25:\"20201009122453ziangs1.jpg\";i:1;s:77:\"202010141147534741b4_4a165bde264042f4b57735f4af51415b_mv2_d_3264_1836_s_2.jpg\";i:2;s:79:\"202010141147564741b4_dbf6bd37e48c4a318bb01a09ca55c632_mv2_d_2976_2976_s_4_2.jpg\";i:3;s:26:\"20201014114923download.jpg\";}', NULL, 'ER', NULL, NULL, NULL, NULL, NULL, NULL, '51.2067553', '-3.4741759', 'yes', 'yes', NULL, 'yes', '2020-10-09', '2023-09-20 11:46:13'),
(34, 'Piggy in the Middle', 'active', '3', 'Fish & chips', '2', 'Piggy In The Middle sells high quality Fish and Chips plus an exceptionally wide variety of pies including various Meat, Vegetarian, Gluten Free and Vegan', 'TA24 8PS', 'Piggy in the Middle', 'High Street, Porlock', 'Minehead', 'Somerset', 'United Kingdom', '', '+44 1643 862647', '', 'closed', NULL, NULL, 'closed', NULL, NULL, 'closed', NULL, NULL, 'open', '17:00', '21.00', 'open', '17.00', '21.00', 'open', '17.00', '21.00', 'closed', NULL, NULL, 'piggy-in-the-middle', '20201015120808img-20180712-204921-164.jpg', 'a:6:{i:0;s:36:\"20201012105959hcmp126127_959528.jpeg\";i:1;s:36:\"20201012105959hcmp126127_959523.jpeg\";i:4;s:36:\"20201012110043hcmp126127_432039.jpeg\";i:5;s:56:\"20201015120025first_20201012105855hcmp126127_432036.jpeg\";i:7;s:41:\"20201015121051img-20180712-204921-164.jpg\";i:8;s:37:\"20201015121053piggy-in-the-middle.jpg\";}', NULL, 'ER', NULL, NULL, NULL, NULL, NULL, NULL, '51.2095507', '-3.595216499999999', 'yes', 'yes', NULL, 'no', '2020-10-09', '2020-12-31 15:35:14'),
(35, 'The Stags Head Inn', 'active', '80', 'Take away,Pub,Fish & chips', '2', 'The Stags Head is located in West Street Dunster, the oldest part of the village.  We are ideally situated for walkers, dog walkers, and visitors to Dunster, a pretty medieval Village steeped in history and untouched by time.  Exmoor National Park is our backdrop and is perfect if you enjoy walking.   Here at the Stags Head, we like to think that people arrive as strangers and leave as friends.  We are very dog-friendly, we have many fur babies who are regulars.  The Stags is a real ale pub offering guest ales every week.  We like to source our ales locally we have to date had ales from Glastonbury Ales, On The Level Brew, Exmoor Ales, Otter, Quantock & St Austell.  We have craft ciders which again we try to use local suppliers, we currently have Porlock Vale & Harrys.  Our wines are local too, tried and tested by our locals.  And now we have had our gin distilled by The Dunster Distillery \'The Stags Head Gin\' perfectly paired with an Elderflower tonic.  We serve food on limited days in winter and all our food is homemade.  We are not just a pub we are a community pub, offering live music, quiz nights, and tap takeovers.  Follow us on Facebook The Stags Head - Dunster to see all upcoming events & more.\r\nWe hope to see you soon\r\nNigel, Janie, Ringo & Pepper', 'TA24 6SN', 'Stags Head', '10 West Street, Dunster', 'Minehead', 'Somerset', 'United Kingdom', 'burcot@aol.com', '07727638819', 'www.thestagsheadinn.co.uk', 'open', '5.00 pm', '8.00 pm', 'open', '5.00 pm', '10.00 pm', 'open', '4.30 pm', '10.00 pm', 'open', '5.00 pm', '10.00 pm', 'open', '4.00 pm', '11.00 pm', 'open', '1.00 pm', '11.00 pm', 'open', '1.00 pm - 3.00 pm', '5.00 pm - 10.00 pm', 'the-stags-head-inn', '20240808112044FBIMG1702937432781.jpg', 'a:8:{i:14;s:37:\"20250120040430bottomdeckfireplace.jpg\";i:15;s:24:\"20250120040509garden.jpg\";i:16;s:26:\"20250120040536Room1bed.jpg\";i:17;s:24:\"20250120040558room32.jpg\";i:18