(58, 'The Royal Oak Inn', 'active', '22', 'Pub,Restaurant', '2', 'The Royal Oak Inn is a traditional 18th century Inn that has 8 En-Suite bedrooms, 2 bar areas & a beautifully decorated dining area that can comfortable accommodate up to 40 diners, providing a quieter atmosphere than will be found in the bars. \r\nWith an extensive menu, using locally sourced ingredients, there is always something on the menu to cater for all, children & dogs included with their own menus!  \r\nThere is a great outdoor area with lots of seating, some covered, and outdoor bar which is popular over the summer months. \r\n', ' TA24 7QP', 'Royal Oak Inn', 'Withypool', 'Minehead', 'Somerset', 'United Kingdom', 'joinus@royaloakwithypool.co.uk', '+44 1643 831506', 'https://royaloakwithypool.co.uk/', 'open', '12:00', '23:00', 'open', '12:00', '23:00', 'open', '12:00', '23:00', 'open', '12:00', '23:00', 'open', '12:00', '23:00', 'open', '12:00', '23:00', 'open', '12:00', '22:30', 'the-royal-oak-inn-withypool', '20201028011901Screenshot_5.png', 'a:7:{i:0;s:30:\"20201028011045Screenshot_4.png\";i:1;s:55:\"20210107014033E33B3D16-A00F-4D66-8EDB-4EB7CC8B3A43.jpeg\";i:2;s:55:\"202101070140353994701A-FDF3-4343-9FFF-51B61E8FE15B.jpeg\";i:3;s:55:\"20210107014035AD1B9983-EF77-4D07-B9B3-AC2141BAA1F9.jpeg\";i:4;s:55:\"20210107014150DCB07BB2-D278-4D7A-A4BF-23EF4525CB53.jpeg\";i:5;s:55:\"202101070141526F60A97B-5EF7-481A-A642-97351B4C8E57.jpeg\";i:6;s:55:\"202101070142382D6A6EEC-DD83-4FBC-B655-A47DEB6E4B09.jpeg\";}', NULL, 'ER', NULL, NULL, NULL, NULL, NULL, NULL, '51.1075948', '-3.649552899999999', 'yes', 'yes', NULL, 'yes', '2020-10-28', '2021-01-07 13:42:39'),
