(63, 'Kitnors', 'active', '3', 'Cafe', '2', 'Welcome to Kitnors! Nestled in the picture postcard village of Bossington on the National Trustâ€™s Holnicote Estate, this charming Grade 2 listed, thatched cottage has been around, since at least the 15th Century, and a tea room since the 1960â€™s. Its beautiful and tranquil cottage garden is the perfect place to relax and breath in the country air, whilst enjoying a well-earned cup of tea and a slice of cake. Light lunches are also served and of course no visit is complete without indulging in a homemade cream tea with lashings of jam and cream! We welcome dogs in the garden, and have on offer our home made \'Furry Friends\' dog biscuits!', 'TA24 8HQ', 'Kitnors', 'Bossington', 'Minehead', 'Somerset', 'United Kingdom', 'kitnors@hotmail.com', '01643 862643', 'https://www.kitnors.com/', 'open', '11:00', '16:30', 'open', '11:00', '16:30', 'open', '11:00', '16:30', 'open', '11:00', '16:30', 'open', '11:00', '16:30', 'open', '11:00', '16:30', 'open', '11:00', '16:30', 'kitnors-kitchen', '20210330095733IMG_0242.jpg', 'a:15:{i:1;s:26:\"20201029115522kitnors2.jpg\";i:2;s:26:\"20201029115528kitnors3.jpg\";i:3;s:26:\"20201029115528kitnors5.jpg\";i:4;s:26:\"20201029115529kitnors6.jpg\";i:5;s:26:\"20201029115529kitnors7.jpg\";i:6;s:26:\"20201029115547kitnors4.jpg\";i:7;s:34:\"20210128102739Chocolate_scones.jpg\";i:8;s:24:\"20210128102754Rabbit.jpg\";i:10;s:28:\"20210128102801Front_sidw.jpg\";i:11;s:23:\"20210128105030Gate#.jpg\";i:12;s:25:\"20210128105038Kitnors.jpg\";i:13;s:33:\"20210128105048Table_in_garden.jpg\";i:14;s:30:\"20210330095335IMG_0242_(1).jpg\";i:15;s:27:\"20210330095337kitnors_2.jpg\";i:16;s:26:\"20210330095338IMG_0392.jpg\";}', NULL, 'ER', NULL, NULL, NULL, NULL, NULL, NULL, '51.22010078810708', '-3.579370195770264', 'yes', 'yes', NULL, 'no', '2020-10-29', '2021-03-30 09:57:57'),
