(31, 'The Bottom Ship', 'active', '78', 'ChIJpTwiLJDZbUgRUep_sKdFz2o', 'no', 'Pub,Restaurant', '2', 'The Bottom Ship Inn is situated in the picturesque location of Porlock Weir, a 15th Century hamlet overlooking the Bristol Channel.\r\n\r\n\r\nWe are a small independently run free house with ample outdoor seating for those enjoying a sunny day spent in the tranquillity of our little corner of Somerset and a roaring log fire for the wet and windy countryside afternoons. We serve a great selection of homemade food coupled with local ales, lagers and cider.\r\n\r\nWe are very dog friendly and families with children are more than welcome.\r\n\r\nWe offer three bed and breakfast rooms all of which en-suite, have tea and coffee facilities and television.\r\n\r\nBeing right on the South West Coast Path, the Bottom Ship is an ideal stopover for walkers and also for those who just want to escape for a few days R&R.\r\n\r\nPorlock Weir itself has several shops in keeping with the attractive surroundings as well as a small museum highlighting the history of the village.\r\n\r\nThe harbour is an old fishing weir, but now the fishing trade has gone (although you will still see a boat or 2!) the village has become a popular destination for day visitors to come and enjoy the beautiful surroundings and for those wanting to stay a bit longer and relax in relative peace and quiet.', 'TA24 8PB', 'The Ship Inn', 'Porlock Weir', 'Minehead', 'Somerset', 'United Kingdom', 'enquiries@shipinnporlockweir.co.uk', '+44(0) 1643 863', 'https://www.shipinnporlockweir.co.uk/food-drink/', 'open', '9:00', '11:00', 'open', '9:00', '11:00', 'open', '9:00', '11:00', 'open', '9:00', '11:00', 'open', '9:00', '11:00', 'open', '9:00', '11:00', 'open', '9:00', '11:00', 'the-bottom-ship', '20201014104129the-ship-inn-porlock-fish-and-chips-e1542974059897.jpg', 'a:5:{i:0;s:43:\"20201009114658Ship-Inn-Porlock-Weir-013.jpg\";i:1;s:23:\"20201014100743steak.jpg\";i:2;s:68:\"20201014101644the-ship-inn-porlock-fish-and-chips-e1542974059897.jpg\";i:3;s:55:\"20201014102009Ship-Inn-Porlock-Weir-bar-012-lighter.jpg\";i:5;s:49:\"20210123025956Ship-Inn-Porlock-Weir-front-016.jpg\";}', NULL, 'ER', NULL, NULL, NULL, NULL, NULL, NULL, 51.217880, -3.627686, 'yes', 'yes', 9.69, '2020-10-09', '2025-10-27 09:31:01'),
