(33, 'Ziangs', 'active', '79', 'ChIJn678XWjdbUgRjd8GnWse30Q', 'no', 'Chinese,Asian', '2', 'We have been cooking real street food from China, Malaysia, Indonesia and Thailand for over 3 Generations.\r\n\r\nServing the best street food in the area since the 1950\'s.  menu only features 5-6 main dishes because we believe in doing a few things well rather than a lot okay, we know this could get boring, which is why we change the menu every 2-3 weeks, this keeps it fun and exciting for the customers and the kitchen team! It\'s also one of the reasons we don\'t hand out menus.', 'TA24 5AY', '35a The Avenue', '', 'Minehead', 'Somerset', 'United Kingdom', 'ziangs35a@gmail.com', '', 'https://www.ziangs35a.com', 'closed', NULL, NULL, 'open', '12:00', '18:00', 'open', '12:00', '18:00', 'open', '12:00', '18:00', 'open', '12:00', '18:00', 'open', '12:00', '18:00', 'open', '12:00', '16:00', 'ziangs', '20201014114912pad-thai.jpg', 'a:4:{i:0;s:25:\"20201009122453ziangs1.jpg\";i:1;s:77:\"202010141147534741b4_4a165bde264042f4b57735f4af51415b_mv2_d_3264_1836_s_2.jpg\";i:2;s:79:\"202010141147564741b4_dbf6bd37e48c4a318bb01a09ca55c632_mv2_d_2976_2976_s_4_2.jpg\";i:3;s:26:\"20201014114923download.jpg\";}', NULL, 'ER', NULL, NULL, NULL, NULL, NULL, NULL, 51.206757, -3.474176, 'yes', 'yes', 10.00, '2020-10-09', '2025-10-27 09:31:01'),
