(35, 'The Stags Head Inn', 'active', '80', 'ChIJ43IfzN_dbUgRCpgHnSXzx_I', 'no', 'Take away,Pub,Fish & chips', '2', 'The Stags Head is located in West Street Dunster, the oldest part of the village.  We are ideally situated for walkers, dog walkers, and visitors to Dunster, a pretty medieval Village steeped in history and untouched by time.  Exmoor National Park is our backdrop and is perfect if you enjoy walking.   Here at the Stags Head, we like to think that people arrive as strangers and leave as friends.  We are very dog-friendly, we have many fur babies who are regulars.  The Stags is a real ale pub offering guest ales every week.  We like to source our ales locally we have to date had ales from Glastonbury Ales, On The Level Brew, Exmoor Ales, Otter, Quantock & St Austell.  We have craft ciders which again we try to use local suppliers, we currently have Porlock Vale & Harrys.  Our wines are local too, tried and tested by our locals.  And now we have had our gin distilled by The Dunster Distillery \'The Stags Head Gin\' perfectly paired with an Elderflower tonic.  We serve food on limited days in winter and all our food is homemade.  We are not just a pub we are a community pub, offering live music, quiz nights, and tap takeovers.  Follow us on Facebook The Stags Head - Dunster to see all upcoming events & more.\r\nWe hope to see you soon\r\nNigel, Janie, Ringo & Pepper', 'TA24 6SN', 'Stags Head', '10 West Street, Dunster', 'Minehead', 'Somerset', 'United Kingdom', 'burcot@aol.com', '07727638819', 'www.thestagsheadinn.co.uk', 'open', '5.00 pm', '8.00 pm', 'open', '5.00 pm', '10.00 pm', 'open', '4.30 pm', '10.00 pm', 'open', '5.00 pm', '10.00 pm', 'open', '4.00 pm', '11.00 pm', 'open', '1.00 pm', '11.00 pm', 'open', '1.00 pm - 3.00 pm', '5.00 pm - 10.00 pm', 'the-stags-head-inn', '20240808112044FBIMG1702937432781.jpg', 'a:8:{i:14;s:37:\"20250120040430bottomdeckfireplace.jpg\";i:15;s:24:\"20250120040509garden.jpg\";i:16;s:26:\"20250120040536Room1bed.jpg\";i:17;s