CREATE TABLE `faq` (
  `id` int(11) NOT NULL,
  `question` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `answer` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT NULL,
  `is_active` tinyint(1) DEFAULT '1',
  `sort_order` int(11) DEFAULT '0'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

--
-- Дамп данных таблицы `faq`
--

(1, 'How do I book a property through your website?', '<p>Browse our cottages, choose your dates, and follow the simple steps to book online. You&#39;ll receive instant confirmation once payment is made. <a href=\"https://thebestofexmoor.freshdesk.com/en/support/solutions/articles/77000482202-how-to-book-a-desired-cottage-for-your-stay-\">Click here</a> for a Step-by-step process.</p>\r\n', '2025-07-05 18:47:39', NULL, 1, 0),
(2, 'Will I receive booking confirmation and arrival instructions?', '<p>Once your payment is completed in full, you&rsquo;ll get your booking confirmation and arrival details right away.</p>\r\n', '2025-07-05 18:47:57', NULL, 1, 0),
(3, 'Can I amend or cancel my booking after confirmation?', '<p>Yes, but it depends on the property&#39;s cancellation policy. Contact us as early as possible to discuss your options.</p>\r\n', '2025-07-07 05:29:50', NULL, 1, 0),
(4, 'When do I need to pay the balance due for my stay?', '<p>The balance is usually due 6 weeks before arrival. You&#39;ll receive a reminder via email when it&#39;s time to pay.</p>\r\n', '2025-07-07 05:30:03', NULL, 1, 0),
(5, 'Do I need to pay a security deposit?', '<p>Some properties require a security deposit, which is held securely and refunded after your stay if no damage is reported.</p>\r\n', '2025-07-07 05:30:16', NULL, 1, 0),
(6, 'What is included in the price of my booking?', '<p>Prices include the property rental, linen, towels (unless stated otherwise), cleaning, and utilities. Some extras may carry a small charge.</p>\r\n', '2025-07-07 05:30:29', NULL, 1, 0),
(7, 'Can I book multiple properties at the same time?', '<p>Yes, you can make separate bookings for each property or contact us to help coordinate group bookings.</p>\r\n', '2025-07-07 05:30:47', NULL, 1, 0),
(8, 'Are linens, towels, and cleaning included?', '<p>Yes, unless otherwise stated. Most of our cottages include fresh linen, towels, and a professional clean between stays.</p>\r\n', '2025-07-07 05:30:58', NULL, 1, 0),
(9, 'Is early check-in or late check-out available?', '<p>This depends on the property and the cleaning schedule. Please ask in advance and we&rsquo;ll do our best to help. For more details, <a href=\"https://thebestofexmoor.freshdesk.com/support/solutions/articles/77000482210-can-i-check-in-early-or-check-out-late-\" target=\"_blank\">check here</a>.</p>\r\n', '2025-07-07 05:31:14', NULL, 1, 0),
(10, 'What happens if I need to cancel due to an emergency?', '<p>We&rsquo;ll do our best to help. Refunds or date changes depend on the property&rsquo;s cancellation policy. We recommend Cancellation cover to choose while you make a booking.</p>\r\n', '2025-07-07 05:31:28', NULL, 1, 0),
(11, 'How far in advance should I book to guarantee availability?', '<p>We recommend booking 3&ndash;6 months in advance, especially for school holidays or popular cottages.</p>\r\n', '2025-07-07 05:31:43', NULL, 1, 0),
(12, 'Can I book a property for a short break or weekend only?', '<p>Yes, many properties allow short stays, particularly outside peak season. Minimum nights apply.</p>\r\n', '2025-07-07 05:32:22', NULL, 1, 0),
(13, 'Are your properties suitable for families with children?', '<p>Yes. We offer many family-friendly cottages, some with enclosed gardens, highchairs, and games.</p>\r\n', '2025-07-07 05:32:33', NULL, 1, 0),
(14, 'Do you offer dog-friendly accommodation?', '<p>Absolutely! Many of our cottages welcome dogs&mdash;just use the &ldquo;dog-friendly&rdquo; filter when searching.</p>\r\n', '2025-07-07 05:32:45', NULL, 1, 0),
(15, 'How do I know if a property is wheelchair accessible?', '<p>Use the &ldquo;accessible&rdquo; filter when searching or check the property description for step-free access and ground-floor bedrooms.</p>\r\n', '2025-07-07 05:32:59', NULL, 1, 0),
(16, 'Can I make a booking over the phone instead of online?', '<p>Yes, call us and we&rsquo;ll help you book over the phone if you prefer not to use the website.</p>\r\n', '2025-07-07 05:33:11', NULL, 1, 0),
(17, 'What should I do if I havenâ€™t received my booking confirmation?', '<p>Check your junk/spam folder first. If it&rsquo;s not there, contact us and we&rsquo;ll resend it straight away.</p>\r\n', '2025-07-07 05:33:27', NULL, 1, 0),
(18, 'Do your properties have WiFi and mobile signal coverage?', '<p>Most have WiFi, but mobile signal can vary in rural areas. Check the listing for details or contact us to confirm.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2025-07-07 05:33:38', NULL, 1, 0),
(19, 'Are there any additional fees not shown in the price?', '<p>All mandatory charges are shown upfront. Optional extras (like dog fees or travel cots) are clearly listed before checkout.</p>\r\n', '2025-07-07 05:33:54', NULL, 1, 0),
(20, 'Can I request a specific check-in or check-out time?', '<p>Check-in and out times are fixed to allow for cleaning, but we&rsquo;ll try to help if you have a special request.</p>\r\n', '2025-07-07 05:34:04', NULL, 1, 0),
(21, 'Do I need to create an account to make a booking?', '<p>No account is needed, you can book as a guest.</p>\r\n', '2025-07-07 05:34:17', NULL, 1, 0),
(22, 'How can I see guest reviews before choosing a property?', '<p>Many listings include guest feedback. You can also contact us for more details if needed.</p>\r\n', '2025-07-07 05:34:29', NULL, 1, 0),
(23, 'Are last-minute bookings allowed, and how do they work?', '<p>Yes, Properties with last-minute availability can be booked online up to the day of arrival, depending on owner approval.</p>\r\n', '2025-07-07 05:34:41', NULL, 1, 0),
(24, 'Can I request extras like a travel cot or high chair?', '<p>Yes, many properties provide these if requested in advance. Check the listing or contact us to arrange.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2025-07-07 05:35:00', NULL, 1, 0),
(25, 'What should I do if I arrive late at the property?', '<p>Arrival instructions will cover late check-ins. Most cottages have key safes, so arriving late is usually fine.</p>\r\n', '2025-07-07 05:35:12', NULL, 1, 0),
(26, 'Is it possible to extend my stay after checking in?', '<p>If the dates are available, we&rsquo;ll gladly extend your booking&mdash;just let us know as soon as possible.</p>\r\n', '2025-07-07 05:35:24', NULL, 1, 0),
(27, 'Can I book a stay as a gift for someone else?', '<p>Yes! Enter their details at booking or contact us to arrange a surprise or gift voucher.</p>\r\n', '2025-07-07 05:35:36', NULL, 1, 0),
(28, 'What happens if the property I booked becomes unavailable?', '<p>We&rsquo;ll notify you immediately and help you find a similar alternative or refund you fully based on the scenario.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2025-07-07 05:35:51', NULL, 1, 0),
(29, 'Are the properties cleaned between guest stays?', '<p>Yes, all cottages are professionally cleaned between guests, with high standards of hygiene.</p>\r\n', '2025-07-07 05:36:06', NULL, 1, 0),
(30, 'Do I need to bring my own toiletries or kitchen essentials?', '<p>We recommend bringing your own. Most properties provide basics, but supplies vary by cottage.</p>\r\n', '2025-07-07 05:36:17', NULL, 1, 0),
(31, 'Can I filter properties by features like sea views or open fires?', '<p>Yes, our website lets you filter by features like open fires, sea views, hot tubs, and more.</p>\r\n', '2025-07-07 05:36:28', NULL, 1, 0),
(32, 'Do you offer gift vouchers or promotional codes?', '<p>Yes, we do! Keep an eye on our website or sign up for our newsletter for current offers.</p>\r\n', '2025-07-07 05:36:39', NULL, 1, 0),
(33, 'Whatâ€™s the difference between flexible and fixed changeover days?', '<p>Fixed changeovers mean set arrival days; flexible allows more choice. Filter this when searching.</p>\r\n', '2025-07-07 05:36:51', NULL, 1, 0),
(34, 'Are the properties inspected or approved in any way?', '<p>Yes, we work closely with all owners and many properties are visited to ensure standards are met.</p>\r\n', '2025-07-07 05:37:07', NULL, 1, 0),
(35, 'Can I get a VAT invoice for my booking?', '<p>Most properties are not VAT registered. However, if the owner is VAT registered, we can issue a VAT invoice upon request. Please let us know at the time of booking if you require one.</p>\r\n', '2025-07-07 05:37:19', NULL, 1, 0),
(36, 'How do I know if the property is suitable for winter stays?', '<p>Look for properties with central heating or log burners. Many are open year-round and cosy in winter.</p>\r\n', '2025-07-07 05:37:29', NULL, 1, 0),
(37, 'What do I do if something is broken or missing on arrival?', '<p>If something is broken or missing when you arrive, please contact us or the housekeeper immediately. We&rsquo;ll work quickly to resolve the issue. Some properties require a security (damage) deposit, which is refundable as long as there&rsquo;s no damage during your stay. If something is found to be missing or damaged, the owner may deduct the cost from your deposit.</p>\r\n', '2025-07-07 05:37:49', NULL, 1, 0),
(38, 'Can I view the exact location of the property before booking?', '<p>Yes, most listings include a map. For privacy, exact details are shared after booking.</p>\r\n', '2025-07-07 05:38:00', NULL, 1, 0),
(39, 'Do you offer long-stay discounts or seasonal offers?', '<p>Yes, some properties offer discounts for longer stays or off-peak bookings. Contact us to ask.</p>\r\n', '2025-07-07 05:38:16', NULL, 1, 0),
(40, 'How is guest privacy handled at shared or semi-detached properties?', '<p>We describe property layouts clearly. Many semi-detached properties have private gardens and separate entrances.</p>\r\n', '2025-07-07 05:38:33', NULL, 1, 0),
(41, 'Are your properties listed on other travel platforms too?', '<p>Yes, many are also on Airbnb and Booking.com, but booking direct often gives you the best rate.</p>\r\n', '2025-07-07 05:39:07', NULL, 1, 0),
(42, 'Whatâ€™s the process for checking out at the end of my stay?', '<p>Check-out is usually by 10 am. Please leave the property tidy and return keys as instructed.</p>\r\n', '2025-07-07 05:39:19', NULL, 1, 0),
(43, 'Who should I contact in case of an emergency during my holiday?', '<p>Arrival instructions include emergency contact numbers. You can also call us if you need urgent help.</p>\r\n', '2025-07-07 05:39:31', NULL, 1, 0),
(44, 'Can I make a booking if I live outside the UK?', '<p>Yes, international guests are very welcome. Our online booking system accepts overseas payments.</p>\r\n', '2025-07-07 05:39:43', NULL, 1, 0),
(45, 'Do you have properties with hot tubs or swimming pools?', '<p>Yes, we do! Use the filters or search terms like &ldquo;hot tub&rdquo; to find them easily.</p>\r\n', '2025-07-07 05:39:54', NULL, 1, 0),
(46, 'Can I speak with someone before I choose a cottage?', '<p>Absolutely, call or email us and we&rsquo;ll be happy to help you find the perfect place.</p>\r\n', '2025-07-07 05:40:05', NULL, 1, 0),
(47, 'What activities are available in Exmoor?', '<p>Exmoor offers a range of activities including walking, horse riding, safaris, and sightseeing in picturesque villages.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2025-07-07 05:40:17', NULL, 1, 0),
(48, 'Are there guides available for local attractions?', '<p>Yes, <a href=\"https://www.thebestofexmoor.co.uk/blog/\">our blog</a> provides information on things to do, places to eat, and events happening in Exmoor.</p>\r\n', '2025-07-07 05:40:37', NULL, 1, 0),
(49, 'How can I find cottages that are close to walking trails or beaches?', '<p>Use filters like &ldquo;near beach&rdquo; or &ldquo;near walking routes&rdquo; or check the map view on our website.</p>\r\n', '2025-07-07 05:40:48', NULL, 1, 0),
(50, 'Do you offer any properties with EV charging points?', '<p>Yes, use the EV charging filter or check individual property descriptions for availability.</p>\r\n', '2025-07-07 05:41:01', NULL, 1, 0),
(51, 'Is there a way to be notified when new properties are added?', '<p>Yes, sign up for our newsletter or follow us on social media for updates on new cottages.</p>\r\n', '2025-07-07 05:41:13', NULL, 1, 0),
(52, 'Are any properties available for corporate or team retreats?', '<p>Yes, we have larger properties perfect for retreats. Let us know your needs and we&rsquo;ll recommend suitable options.</p>\r\n', '2025-07-07 05:41:28', NULL, 1, 0),
(53, 'What should I do if I break something at the cottage?', '<p>If you accidentally break something during your stay, please call the number listed in your arrival instructions as soon as possible. This helps the owner arrange a replacement quickly. Please be aware that any damage costs may be deducted from your security (damage) deposit, if applicable.</p>\r\n', '2025-09-12 10:48:40', NULL, 1, 0);

