(41963, 'richard.vilas@gmail.com', 'Richard  Vilas', 'team@bookingbrain.co.uk', 'Booking Brain', 'Arrival information for your stay in Honeysuckle Cottage, Porlock', '<5ac66b437afc48e5a15303a06ca7b916@www.bookingbrain.co.uk>', '	<div style=\"margin-top: 15px;max-width: 825px;background: #5CB85C; color:white;padding: 35px 20px;\">\n				<h1 style=\"text-align:center;font-size: 30px;margin:0;padding-bottom:0;\">\n			Honeysuckle Cottage, Porlock arrival info \n		</h1>\n		\n				<p style=\"text-align:center; font-size:24px;margin:0;padding:0;\">\n			We look forward to having you on Sat 19 May 2018  		</p>\n			</div>	\n', '<p>Hi&nbsp;Richard ,</p>\r\n\r\n<p>Please find below your arrival&nbsp;information for your stay in&nbsp;Honeysuckle Cottage, Porlock from&nbsp;Sat 19 May 2018  for&nbsp;7 nights. Arrival is any time after 4:00pm. (Please note, the check out time on your day of&nbsp;departure is&nbsp;10:00am)</p>\r\n\r\n<p>Problems during your stay? Please call&nbsp;Alison  on&nbsp;07935 250824,&nbsp;01643 863596</p>\r\n\r\n<p>Property address for Honeysuckle Cottage, Porlock:</p>\r\n\r\n<p>Marleys Row, 2, Porlock, TA24 8LD, </p>\r\n\r\n<p>Arrival Info:&nbsp;</p>\r\n\r\n<p>Please note: you cannot get to the cottage by car, despite what your sat nav might say! The map on the website shows the exact location of the property, scroll to the very bottom of the page to view the map, and you can use to + to zoom right in to show the location and the access roads: https://www.thebestofexmoor.co.uk/stay-in-porlock/honeysuckle-cottage\r\n\r\nDirections:   \r\nEnter Porlock via the A39 and park either in the Doverhay car park as you enter the village (pay and display, charges apply between 9 am and 6 pm, two hours maximum between those hours) or in Parson\'s Street by the church (free parking at the bottom or 300m further up by the recreation ground. You can then reach the cottage by foot along The Drang, either from Doverhay to the east (by the car park) or the High Street from the west (by the church).  \r\n\r\nWhen you see the Marleys Row sign, halfway down The Drang just before if you enter from Doverhay end, or just after if you enter from the Church end, a sharp bend, go down the path to the left (front) of the row of cottages. The first/end cottage is called Marley Cottage and they own the only parking space, so you may need to walk past a vehicle and then to the left of the terrace.   \r\n\r\nHoneysuckle Cottage is number 2, the second cottage in the row.</p>\r\n\r\n<p>Parking Info:&nbsp;</p>\r\n\r\n<p>There is no on-site parking available but there are two pay and display car parks in Porlock, both within a few minutes from the property.  Also there is nearby street parking which is free of charge (Parsons Street by the church, or further up by the Recreation Ground).  You can unload the car in Doverhay Car Park at the entrance to the village (approx. Â£1 for one hour) and then find a parking space once you have taken their luggage to the property in Marleys Row.</p>\r\n\r\n<p>Where to find the key:&nbsp;</p>\r\n\r\n<p>You can collect the key from Alison at number 4 Marleys Row (two doors further down).  Please call or text her mobile a couple of days before your arrival date to let her know your approximate arrival time and make arrangements.</p>\r\n\r\n<p>House Rules (if any):&nbsp;Well behaved dogs are welcome.  Please bring a bed that the dog is used to and towels to dry them after walks before letting inside.  The back courtyard is ideal for cleaning muddy dogs.  Please do not let dogs on the furniture and definitely not upstairs.  Thank you.  \r\nPlease take extra care if you are using the wood-burner as it gets very hot.     </p>\r\n\r\n<p>Booking ID:&nbsp;202074&nbsp;</p>\r\n\r\n<p>We look forward to your stay!</p>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, 'Booking Brain', 'no', 202074, 34, NULL, 'yes', NULL, NULL, NULL, NULL, NULL, '2018-04-05 19:30:27', '2018-04-06 00:30:27');
