(41957, 'simon@edgcotthouse.co.uk', 'Simon & Penny Fitton', 'team@bookingbrain.co.uk', 'Booking Brain', 'Housekeeper Notification- Cascade Cottage, Exford', '<5ac6683597b44130a8c47f456ca7b916@www.thebestofexmoor.co.uk>', '	<div style=\"margin-top: 15px;max-width: 825px;background: #5CB85C; color:white;padding: 35px 20px;\">\n				<h1 style=\"text-align:center;font-size: 30px;margin:0;padding-bottom:0;\">\n			Paid Successfully \n		</h1>\n		\n				<p style=\"text-align:center; font-size:24px;margin:0;padding:0;\">\n			EILEEN arrives on Fri 18 May 2018  		</p>\n			</div>	\n', '<p>Hi Simon & Penny,&nbsp;<br />\r\n<br />\r\nThis is an automated email for a&nbsp;booking.&nbsp;You have EILEEN BARTLETT arriving&nbsp;in Cascade Cottage, Exford on the Fri 18 May 2018  for 7&nbsp;nights. Should you need to, you can contact EILEEN on 7891644570. Number of guests is&nbsp;2 .</p>\r\n\r\n<p>EILEEN&#39;s booking ID is 195539.&nbsp;Booking status is: Paid in Full.&nbsp;</p>\r\n\r\n<p>Let us know if you need extra cleaning days blocked out on either side of this booking.</p>\r\n\r\n<p>Thanks, Chris</p>\r\n', NULL, 'Exmoorholidaycottage', 'no', 195539, 12, NULL, 'yes', NULL, NULL, NULL, NULL, NULL, '2018-04-05 07:17:25', '2018-04-05 12:17:25'),
(41958, 'ebartlett303@gmail.com', 'EILEEN BARTLETT', 'team@bookingbrain.co.uk', 'Booking Brain', 'Arrival information for your stay in Cascade Cottage, Exford', '<5ac66836c8944d07aa897f456ca7b916@www.thebestofexmoor.co.uk>', '	<div style=\"margin-top: 15px;max-width: 825px;background: #5CB85C; color:white;padding: 35px 20px;\">\n				<h1 style=\"text-align:center;font-size: 30px;margin:0;padding-bottom:0;\">\n			Cascade Cottage, Exford arrival info \n		</h1>\n		\n				<p style=\"text-align:center; font-size:24px;margin:0;padding:0;\">\n			We look forward to having you on Fri 18 May 2018  		</p>\n			</div>	\n', '<p>Hi&nbsp;EILEEN,</p>\r\n\r\n<p>Please find below your arrival&nbsp;information for your stay in&nbsp;Cascade Cottage, Exford from&nbsp;Fri 18 May 2018  for&nbsp;7 nights. Arrival is any time after 4:00pm. (Please note, the check out time on your day of&nbsp;departure is&nbsp;10:00am)</p>\r\n\r\n<p>Problems during your stay? Please call&nbsp;Simon and Penny on&nbsp; 01643 831164,&nbsp;</p>\r\n\r\n<p>Property address for Cascade Cottage, Exford:</p>\r\n\r\n<p>Edgcott House, Edgcott Lane, Exford, TA24 7QG, </p>\r\n\r\n<p>Arrival Info:&nbsp;</p>\r\n\r\n<p>From Taunton: take the A358 WEST (which is signposted towards Minehead), this will take you through the outskirts of Taunton and towards Exmoor. The last big roundabout when you are leaving Taunton has a pub beside it called The Cross Keys, approximately 4 miles on from here you turn left onto the B3224, which is signposted Exford (takes you under the railway bridge). Continue on B3224 for just over 17 miles (including turning right at the chapel to stay on the B3224 signposted Wheddon Cross / Exford).\r\n\r\nAt Wheddon Cross, go straight over the crossroads to stay on B3224. Exford is just under 5 miles from Wheddon Cross. At the bottom of the steep hill that drops you down into Exford village, turn right onto Edgcott Road.\r\n\r\nCascade Cottage is approx 0.5 mile on your right, there is a sign to indicate the drive.</p>\r\n\r\n<p>Parking Info:&nbsp;</p>\r\n\r\n<p>There is off-road parking in close proximity to the cottage for two cars. Please park on the drive in front of the cottage and a second car can be parked in the car park on the left as you enter the drive.\r\n</p>\r\n\r\n<p>Where to find the key:&nbsp;</p>\r\n\r\n<p>Please contact Simon and Penny sometime during the week before your arrival date to confirm your arrival time and make arrangements regarding the key (please leave a message if there is no answer).</p>\r\n\r\n<p>House Rules (if any):&nbsp;Please love the cottage as if it\'s your own and remember to leave the key when you depart, thank you. Please email us 24 hours after your departure to request your damage deposit is refunded. </p>\r\n\r\n<p>Booking ID:&nbsp;195539&nbsp;</p>\r\n\r\n<p>We look forward to your stay!</p>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, 'Exmoorholidaycottage', 'no', 195539, 34, NULL, 'yes', NULL, NULL, NULL, NULL, NULL, '2018-04-05 07:17:26', '2018-04-05 12:17:26'),
