(41952, 'charlottecoley@hotmail.co.uk', 'Charlotte & Marc Coley', 'team@bookingbrain.co.uk', 'Booking Brain', 'Housekeeper Notification- Porlock Hideaway', '<5ac65c6109384c16aa566e2f6ca7b916@www.thebestofexmoor.co.uk>', '	<div style=\"margin-top: 15px;max-width: 825px;background: #5CB85C; color:white;padding: 35px 20px;\">\n				<h1 style=\"text-align:center;font-size: 30px;margin:0;padding-bottom:0;\">\n			Paid Successfully \n		</h1>\n		\n				<p style=\"text-align:center; font-size:24px;margin:0;padding:0;\">\n			Stephanie arrives on Sat 07 Apr 2018  		</p>\n			</div>	\n', '<p>Hi Charlotte & Marc,&nbsp;<br />\r\n<br />\r\nThis is an automated email for a&nbsp;booking.&nbsp;You have Stephanie Wakeman arriving&nbsp;in Porlock Hideaway on the Sat 07 Apr 2018  for 7&nbsp;nights. Should you need to, you can contact Stephanie on 07848861733. Number of guests is&nbsp;2 .</p>\r\n\r\n<p>Stephanie&#39;s booking ID is 202133.&nbsp;Booking status is: Paid in Full.&nbsp;</p>\r\n\r\n<p>Let us know if you need extra cleaning days blocked out on either side of this booking.</p>\r\n\r\n<p>Thanks, Chris</p>\r\n', NULL, 'Exmoorholidaycottage', 'no', 202133, 12, NULL, 'yes', NULL, NULL, NULL, NULL, NULL, '2018-04-05 06:26:57', '2018-04-05 11:26:57'),
(41953, 'cragworkshop@hotmail.co.uk', 'Stephanie Wakeman', 'team@bookingbrain.co.uk', 'Booking Brain', 'Arrival information for your stay in Porlock Hideaway', '<5ac65c614a2846bb8ae06e2f6ca7b916@www.thebestofexmoor.co.uk>', '	<div style=\"margin-top: 15px;max-width: 825px;background: #5CB85C; color:white;padding: 35px 20px;\">\n				<h1 style=\"text-align:center;font-size: 30px;margin:0;padding-bottom:0;\">\n			Porlock Hideaway arrival info \n		</h1>\n		\n				<p style=\"text-align:center; font-size:24px;margin:0;padding:0;\">\n			We look forward to having you on Sat 07 Apr 2018  		</p>\n			</div>	\n', '<p>Hi&nbsp;Stephanie,</p>\r\n\r\n<p>Please find below your arrival&nbsp;information for your stay in&nbsp;Porlock Hideaway from&nbsp;Sat 07 Apr 2018  for&nbsp;7 nights. Arrival is any time after 4:00pm. (Please note, the check out time on your day of&nbsp;departure is&nbsp;10:00am)</p>\r\n\r\n<p>Problems during your stay? Please call&nbsp;Charlotte on&nbsp;07989 868964,&nbsp;07927 354057</p>\r\n\r\n<p>Property address for Porlock Hideaway:</p>\r\n\r\n<p>The Old Tannery,  Porlock, TA24 8PU, </p>\r\n\r\n<p>Arrival Info:&nbsp;</p>\r\n\r\n<p>Exit the M5 at either Junction 23 (via Bridgwater) or Junction 25 (via Taunton) and follow signs to Minehead. Upon reaching Minehead, continue on A39 following signs to Porlock.  \r\nUpon entering the village of Porlock, follow the High Street past the church. Then turn right down the lane at the side of the hardware shop, just after the garage.\r\n</p>\r\n\r\n<p>Parking Info:&nbsp;</p>\r\n\r\n<p>Follow the lane to the right when it forks and continue as far as you can, to get to The Hideaway parking spot which is near the wooden gates. There is a sign on the wall to indicate the parking space.</p>\r\n\r\n<p>Where to find the key:&nbsp;</p>\r\n\r\n<p> The entrance to The Hideaway is via the courtyard you will have passed to get to the parking space.  The Hideaway front door is at the far end of the courtyard, in the left hand corner.  \r\n\r\nBelow The Hideaway sign beside the front door is a thumb wheel key box. Slide the black protective cover upwards to see the dials.  The code is 2409, then press the black bottom and key will come out. Please ensure you return dials to 0000 once you have got the key. You may wish to bring a torch if you will be arriving in the dark.  </p>\r\n\r\n<p>House Rules (if any):&nbsp;Please love the property like it\'s your own.  Please remember to leave the key in the key-safe when you depart, thank you.</p>\r\n\r\n<p>Booking ID:&nbsp;202133&nbsp;</p>\r\n\r\n<p>We look forward to your stay!</p>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, 'Exmoorholidaycottage', 'no', 202133, 34, NULL, 'yes', NULL, NULL, NULL, NULL, NULL, '2018-04-05 06:26:57', '2018-04-05 11:26:57'),
