(41948, 'annabel@wilkesfamily.info', 'Annabel Wilkes', 'team@bookingbrain.co.uk', 'Booking Brain', 'Arrival information for your stay in Horner Cottage, Luccombe', '<5ac651c351104ea38a8755686ca7b916@www.thebestofexmoor.co.uk>', '	<div style=\"margin-top: 15px;max-width: 825px;background: #5CB85C; color:white;padding: 35px 20px;\">\n				<h1 style=\"text-align:center;font-size: 30px;margin:0;padding-bottom:0;\">\n			Horner Cottage, Luccombe arrival info \n		</h1>\n		\n				<p style=\"text-align:center; font-size:24px;margin:0;padding:0;\">\n			We look forward to having you on Wed 11 Apr 2018  		</p>\n			</div>	\n', '<p>Hi&nbsp;Annabel,</p>\r\n\r\n<p>Please find below your arrival&nbsp;information for your stay in&nbsp;Horner Cottage, Luccombe from&nbsp;Wed 11 Apr 2018  for&nbsp;3 nights. Arrival is any time after 3:00pm. (Please note, the check out time on your day of&nbsp;departure is&nbsp;10:00am)</p>\r\n\r\n<p>Problems during your stay? Please call&nbsp;Phil Palmer on&nbsp;01643 862176,&nbsp;07876 594501</p>\r\n\r\n<p>Property address for Horner Cottage, Luccombe:</p>\r\n\r\n<p>Manor House, Luccombe, TA24 8TE, </p>\r\n\r\n<p>Arrival Info:&nbsp;</p>\r\n\r\n<p>We\'d appreciate it if you could call or text a day or 2 before your arrival with an ETA - thanks!.\r\n\r\nThe turn off to Luccombe is signposted and approx 4 miles past Minehead on the A39 going towards Porlock.  Take the turning and follow the lane for approx 1.5 miles (itâ€™s quite narrow and windy so expect to need to do some reversing into passing places!) until you get to a T junction - our entrance is directly opposite the T junction.  If you can text/call me when you get to Minehead Iâ€™ll know youâ€™re approx 10 mins away.</p>\r\n\r\n<p>Parking Info:&nbsp;</p>\r\n\r\n<p>There is parking for one car on the drive, just a short walk from the front door (approx 50 metres). </p>\r\n\r\n<p>Where to find the key:&nbsp;</p>\r\n\r\n<p>Please pull up outside the Manor House and ring the door bell and we\'ll come and show you where to park and show you to your cottage and give you keys and cottage info.</p>\r\n\r\n<p>House Rules (if any):&nbsp;No pets on furniture or upstairs please.</p>\r\n\r\n<p>Booking ID:&nbsp;202132&nbsp;</p>\r\n\r\n<p>We look forward to your stay!</p>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, 'Exmoorholidaycottage', 'no', 202132, 34, NULL, 'yes', NULL, NULL, NULL, NULL, NULL, '2018-04-05 05:41:39', '2018-04-05 10:41:39'),
