(41927, 'andreaatt09@googlemail.com', 'Andrea Attwell', 'team@bookingbrain.co.uk', 'Booking Brain', 'Housekeeper - New Booking Notification Quay Cottage, Porlock Weir', '<5ac6496b9ad04fd6be824d906ca7b916@www.thebestofexmoor.co.uk>', '	<div style=\"margin-top: 15px;max-width: 825px;background: #FFC45A; color:white;padding: 35px 20px;\">\n				<h1 style=\"text-align:center;font-size: 30px;margin:0;padding-bottom:0;\">\n			Deposit Received \n		</h1>\n		\n				<p style=\"text-align:center; font-size:24px;margin:0;padding:0;\">\n			Pippa arrives on Fri 05 Apr 2019  		</p>\n			</div>	\n', '<p>Hi Andrea,&nbsp;<br />\r\n<br />\r\nThis is an automated email for a&nbsp;booking.</p>\r\n\r\n<p>You have a Pippa Duncan&nbsp;arriving&nbsp;in Quay Cottage, Porlock Weir on the Fri 05 Apr 2019  for 7&nbsp;nights. Should you need to, you can contact Pippa on 02088781890/079. This booking is for&nbsp;5 guests.</p>\r\n\r\n<p>Pippa&#39;s booking ID&nbsp;is 202129.&nbsp;Booking status is: deposit paid.</p>\r\n\r\n<p>Let us know if you need extra cleaning days blocked out on either side of this booking.<br />\r\n<br />\r\nThanks, Chris</p>\r\n', NULL, 'Exmoorholidaycottage', 'no', 202129, 16, NULL, 'yes', NULL, NULL, NULL, NULL, NULL, '2018-04-05 05:06:03', '2018-04-05 10:06:03'),
(41928, 'team@bookingbrain.co.uk', 'Booking Brain', 'richard.vilas@gmail.com', 'Richard Vilas', 'Thanks for getting in touch!', '<5ac64a6394c44e989e7c4e676ca7b916@www.bookingbrain.co.uk>', '	<div style=\"margin-top: 15px;max-width: 825px;background: #1BB0E2; color:white;padding: 35px 20px;\">\n				<h1 style=\"text-align:center;font-size: 30px;margin:0;padding-bottom:0;\">\n			Ping! You\'ve got a new message \n		</h1>\n		\n			</div>	\n', '<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>Sender Name:</td>\r\n			<td>Richard Vilas &nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Sender Email:</td>\r\n			<td>richard.vilas@gmail.com</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Sender Contact No:</td>\r\n			<td>01 541 4821635</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"2\"><div style=\"padding:10px; color: #000;\"><br>I have been trying to book Honeysuckle Cottage in Porlock since yesterday. I have the confirmation number, but was advised by Chris by email that the payment did not go through. I replied that when Ihave filled in all the fields that the billing state is required for the US. I have place it in the Zip code field and in the city field with the city name to no avail. Can you please help me get this completed?\r\nThank you ,\r\nRichard Vilas <br><br></div></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, 'Booking Brain', 'no', NULL, 35, NULL, 'yes', NULL, NULL, NULL, NULL, NULL, '2018-04-05 17:10:11', '2018-04-05 22:10:11'),
