(41919, 'team@bookingbrain.co.uk', 'The Best of  Exmoor', 'ceripoole@sky.com', 'Ceri Poole', 'Voucher for 5% deposit', '<5ac64937e1084d5cb5da54b4ac1f33d0@www.bookingbrain.co.uk>', '	<div style=\"margin-top: 15px;max-width: 825px;background: #1BB0E2; color:white;padding: 35px 20px;\">\n				<h1 style=\"text-align:center;font-size: 30px;margin:0;padding-bottom:0;\">\n			Book again with only 5% deposit \n		</h1>\n		\n			</div>	\n', '<p>Hi Ceri,</p>\r\n\r\n<p>Thanks for staying with us last week and I hope you enjoyed your stay in&nbsp;Stag Cottage, Porlock.&nbsp;</p>\r\n\r\n<p>I&#39;ve created a unique voucher code for you, which entitles you to book any property on www.thebestofexmoor.co.uk or www.secretretreats.co.uk with a reduced deposit, only 5%.</p>\r\n\r\n<p>Your unique voucher code is - CeriFIKGT</p>\r\n\r\n<p>If you did want to come back to Exmoor, please use this code to redeem this special offer. You can also share your code with your friends and it can be used many times!</p>\r\n\r\n<p>If you have stayed with us more than once, reply to this email and I&#39;ll send you a voucher code for money off your next stay.&nbsp;</p>\r\n\r\n<p>www.thebestofexmoor.co.uk</p>\r\n\r\n<p>Thank you for supporting local business.&nbsp;</p>\r\n\r\n<p>Chris - The Best of Exmoor</p>\r\n', NULL, 'Booking Brain', 'no', 201131, 54, NULL, 'yes', NULL, NULL, NULL, NULL, NULL, '2018-04-05 17:05:11', '2018-04-05 22:05:11'),
